  input: '"TEXT","F3XA","C00055582","This amendment is submitted to include addtional
    contributor identification information received.  Please be advised for the current
    reporting period (07/01/2007-07/31/2007) no employee spent more than 25% of their
    compensated time on federal election activity, therefore all employee compensation
    information is detailed on Schedule H4.  The Committee continues to use the best
    efforts procedures outlined by the FEC to obtain identification information for
    all individuals who contribute in excess of $200 in a calendar year.  All solicitations
    for funds request the required information for proper filing.  Where there is
    incomplete information, a separate follow up letter requesting the complete information
    and advising of the requirements of federal law for the reporting of such information
    is mailed to the individual accompanied by a business reply envelope.  Information
    that is received after the initial filing is reported in an amended filing to
    the FEC."'
